import React from "react";

import "./Results.css";

const ResultsPage = ({ results }) => {
  return (

    <div className="results">
      {results.map((result, id) => {
        return <div key={id}>{result.name} {result.username} {result.email}</div>;
      })}
    </div>
  );
};

export default ResultsPage;
